!function(){"use strict";$.getJSON(window.apiUrl+"/restaurants/following/"+window.username+"/",function(i){var n=$(".template").children().first().clone();$.each(i,function(i,e){var t=n.clone();t.find(".name").text(e.name),t.find(".price-range .low").text(e.price_low),t.find(".price-range .high").text(e.price_high),t.find(".address").text(e.location_name),t.find(".photo img").attr("src","images/"+e.photo),t.find(".photo, .info").wrap('<a href="restaurant.html?id='+e.id+'"></a>'),$(".main-div").append(t)})})}();